// import { useUserinfo } from './../user_info/user_info';

import PaginaPrincipal from './../pagina_principal/pagina_principal'
import Login from './../pagina_login/login';

import { UserinfoProvider } from "../user_info/user_info"

function RotaInicial(){
    


return(
    <UserinfoProvider>

    
    {true ? (
        <PaginaPrincipal />
      ):(
        <Login/>
      )}
</UserinfoProvider>
)

}export default RotaInicial
